import React from 'react';
import ResumeContent from './ResumeContent';
import Draggable from './../Draggable/Draggable';
import Resume from './../../assets/resume.pdf'
import { Button, Radio, Icon } from 'antd';
import './Resume.css';

class Gallery extends React.Component {


    render() {
        return(
          <div className="resume-page-container parallax">

              <h1>R&eacute;sum&eacute;</h1>
              <Button type="primary" shape="round" icon="download" size={16}>
                  Download
              </Button>
              <div className="paper">
                  <ResumeContent/>
              </div>

              <Draggable x={20} y={450}>
                  {/*Note: The 'sticky' class CSS is located in '~/assets/Theme.css'*/}
                  <div className="sticky">
                      <div className="sticky-text"  /*contentEditable="true" spellCheck="false"*/>
                          Last Update: <br/>
                          December 26, 2019 <br/><br/>
                          Upcoming: <br/>
                          Summer Internship with <a href="https://www.pw.utc.com" target="_blank">Pratt and Whitney</a><br/><br/>
                      </div>
                  </div>
              </Draggable>
          </div>
        )
    }
}

export default Gallery
